var $bm_rt;
var freq, amp, loop, complexity, multiplier, seed, loop, t, w1, w2, w;
var fx = thisComp.layer('virus').effect('Rotation Wiggle');
freq = fx(2);
amp = fx(1);
loop = fx(3);
complexity = fx(5);
multiplier = fx(6);
seed = fx(7);
seedRandom(seed);
if (loop == 0)
    loop = thisComp.duration;
t = $bm_sub($bm_mod(time, loop), loop);
w1 = wiggle(freq, amp, complexity, multiplier, t);
w2 = wiggle(freq, amp, complexity, multiplier, $bm_sub(t, loop));
w = ease(t, $bm_neg(loop), 0, w1, w2);
$bm_rt = $bm_sub($bm_sum(w, value), valueAtTime(0));

