var $bm_rt;
var fx = thisComp.layer('virus').effect('Looper');
var isIn = fx(2).value;
var isOut = fx(7).value;
var inType = fx(3).value;
var outType = fx(8).value;
var outNumKeyframes = fx(9).value;
var inNumKeyframes = fx(4).value;
var result = value;
if (numKeys > 1) {
    if (time < key(1).time && isIn) {
        if (inType == 1)
            result = loopIn('cycle', outNumKeyframes);
        else if (inType == 2)
            result = loopIn('offset', outNumKeyframes);
        else if (inType == 3)
            result = loopIn('pingpong', outNumKeyframes);
        else if (inType == 4)
            result = loopIn('continue');
    } else if (time > key(numKeys).time && isOut) {
        if (outType == 1)
            result = loopOut('cycle', outNumKeyframes);
        else if (outType == 2)
            result = loopOut('offset', outNumKeyframes);
        else if (outType == 3)
            result = loopOut('pingpong', outNumKeyframes);
        else if (outType == 4)
            result = loopOut('continue');
    }
}
$bm_rt = result;

